from tqdm import tqdm

class Solution(object):
    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """

        if not s:
            return ""
        
        longest = ""
        for i in tqdm(range(len(s))):
            if len(longest) >= len(s[i:]):
                break
            for j in range(len(s), i, -1):
                if len(longest) >= j-i:
                    break
                elif self.isPalindrome(s[i:j]):
                    longest = s[i:j]
                    break
            
        return longest
    
    def isPalindrome(self, x):
        """
        :type x: int
        :rtype: bool
        """
        str_x = str(x)
        for i, v in enumerate(str_x):
            if v == str_x[len(str_x)-i-1]:
                pass
            else:
                return False
            
        return True
    
